import React from 'react';
import { Anchor } from 'antd';
import CountrySelect from '../../components/CountrySelect'; 

const { Link } = Anchor;

const Form = () => {
  return (
    <div>
      <Anchor>
        <Link href="#form-country" title="Country" />
        <Link href="#form-land" title="Land" />
      </Anchor>
      <CountrySelect />
    </div>
  )
};

export default Form;
